import axios from "axios";

const initialState = {
	count: 0
};

const InitialProducts = axios.get("https://demo8421975.mockable.io/products").then(res => {
	return {
		Products: "hel"
	}
})

const reducer = (state = InitialProducts, action)=>
{
	return state;
}

export default reducer;
